webpackJsonp([0x15a23b922f5a4b00],{"./node_modules/json-loader/index.js!./.cache/json/bootstrap.json":function(t,a){t.exports={data:{markdownRemark:{html:'<h2>Bootstrap</h2>\n<p>Bootstrap is a popular front-end framework for web development. It contains pre-built components and design elements to style HTML content. Modern browsers such as Chrome, Firefox, Opera, Safari, and Internet Explorer support Bootstrap.</p>\n<p>Bootstrap includes a responsive grid system for varying layouts. It is a great starting point for building a mobile friendly website. It also includes optional JavaScript functionality like collapsible content, carousels, and modals.</p>\n<h4>Version History</h4>\n<p>Twitter originally developed the Bootstrap framework as an internal tool. They released it as an open source project in August of 2011.</p>\n<p>Bootstrap 2 was released in January 2012. One of the primary features was the introduction of the 12 column responsive grid system. Bootstrap 3 appeared in August of 2013, switching to a flat design and a mobile-first approach. Bootstrap 4 is available in beta as of August 2017, and now includes Sass and Flexbox.</p>\n<p>Bootstrap 4 was in development for two years before releasing their first beta in August 2017 and beta 2 in October 2017. Some notable changes include: Moved from less to sass. Moved to flexbox and improved grid system. Added cards (replacing wells, thumbnails, and panels) And much more! At the time of writing, Bootstrap is working on beta 3, if you would like to keep up with any news of announcements from bootstrap, follow them <a href="http://blog.getbootstrap.com/">here</a>.</p>\n<h4>Installation</h4>\n<p>There are two main options to add Bootstrap to your web project. You can link to publicly available sources, or download the framework directly. </p>\n<h5>Linking To Another Source</h5>\n<p>You can add Bootstrap CSS by using a <code>&#x3C;link></code> element inside the <code>&#x3C;head></code> of your webpage that references a Content Delivery Network (CDN):</p>\n<p><code>&#x3C;link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-beta/css/bootstrap.min.css" integrity="sha384-/Y6pD6FV/Vv2HJnA6t+vslU6fwYXjCFtcEpHbNJ0lyAFsXTsjBbfaDjzALeQsN6M" crossorigin="anonymous"></code></p>\n<p>Adding the JavaScript elements of Bootstrap is similar with <code>&#x3C;script></code> elements usually placed at the bottom of your ‘<body>’ tag.  You may need to include some dependencies first. Pay special attention to the order listed:</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://code.jquery.com/jquery-3.2.1.slim.min.js<span class="token punctuation">"</span></span> <span class="token attr-name">integrity</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>sha384-KJ3o2DKtIkvYIK3UENzmM7KCkRr/rE9/Qpg6aAZGJwFDMVNA/GpGFF93hXpG5KkN<span class="token punctuation">"</span></span> <span class="token attr-name">crossorigin</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>anonymous<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.11.0/umd/popper.min.js<span class="token punctuation">"</span></span> <span class="token attr-name">integrity</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>sha384-b/U6ypiBEHpOf/4+1nzFpr53nxSS+GLCkfwBdFNTxtclqqenISfwAzpKaMNFNmj4<span class="token punctuation">"</span></span> <span class="token attr-name">crossorigin</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>anonymous<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-beta/js/bootstrap.min.js<span class="token punctuation">"</span></span> <span class="token attr-name">integrity</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>sha384-h0AbiXch4ZDo7tp9hKZ4TsHbi047NrKGLO3SEJAg45jXxnGIfYzk4Si90RDIqNm1<span class="token punctuation">"</span></span> <span class="token attr-name">crossorigin</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>anonymous<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p><em>Note: These are only examples and may change without notice. Please refer to a CDN for current links to include in your project.</em></p>\n<h5>Download/Install</h5>\n<p>You can download and install the Bootstrap source files with Bower, Composer, Meteor, or npm. This allows greater control and the option to include or exclude modules as needed.</p>\n<p><code>npm install bootstrap@4.0.0-beta</code></p>\n<p><code>gem install bootstrap -v 4.0.0.beta</code></p>\n<p><code>bower install bootstrap#v4.0.0-beta</code></p>\n<p><em>Note: These are only examples and may change without notice. Please refer to the _&#x3C;a href=’<a href="https://getbootstrap.com/">https://getbootstrap.com/</a>’ target=’</em>blank’ rel=‘nofollow’>Bootstrap website</a>_ for the most up-to-date links._</p>\n<h4>The Bootstrap Grid System</h4>\n<p>The grid system is a mobile-first flexbox system for quickly building layouts of all shapes and sizes suitable on all devices. It’s based on a 12 column layout and has multiple tiers, one for each media query range. </p>\n<p>Bootstrap comes with predefined grid classes for your use in markup. See more details and examples at <a href="https://v4-alpha.getbootstrap.com/layout/grid/#how-it-works">https://v4-alpha.getbootstrap.com/layout/grid/#how-it-works</a></p>\n<h4>More Information:</h4>\n<p>Bootstrap has thorough documentation with many <a href=\'https://getbootstrap.com/docs/4.0/examples/\' target=\'_blank\' rel=\'nofollow\'>examples</a> and an <a href=\'https://getbootstrap.com/docs/4.0/getting-started/introduction/\' target=\'_blank\' rel=\'nofollow\'>HTML template for getting started</a> (this template only has script included; it does not contain a set up of the grid system if that’s what you’re looking for). </p>\n<p>In addition, you can find both <a href=\'https://bootswatch.com/\' target=\'_blank\' rel=\'nofollow\'>free</a> and <a href=\'https://themes.getbootstrap.com/\' target=\'_blank\' rel=\'nofollow\'>paid</a>\nthemes that build on the Bootstrap framework to provide a more customized and stylish look.</p>\n<h4>Bootstrap Resources:</h4>\n<p><a href=\'http://blog.getbootstrap.com/\' target=\'_blank\' rel=\'nofollow\'>Bootstrap Blog</a>: Bootstrap’s offical blog\n<a href=\'http://expo.getbootstrap.com/\' target=\'_blank\' rel=\'nofollow\'>Bootstrap Expo</a>: Bootstrap site inspiration\n<a href=\'http://builtwithbootstrap.com/\' target=\'_blank\' rel=\'nofollow\'>Built with Bootstrap</a>: Showcase of sites built using Bootstrap\n<a href=\'https://github.com/twbs/bootlint\' target=\'_blank\' rel=\'nofollow\'>Bootlint</a>: HTML linter for projects using Bootstrap\n<a href=\'https://bootsnipp.com/\' target=\'_blank\' rel=\'nofollow\'>Bootsnipp</a>: Design elements and code snippets for Bootstrap\n<a href=\'http://expo.getbootstrap.com/resources/\' target=\'_blank\' rel=\'nofollow\'>More Resources</a>: Code, theme, and add-on resources for Bootstrap</p>',fields:{slug:"/bootstrap/"},frontmatter:{title:"Bootstrap"}}},pathContext:{slug:"/bootstrap/"}}}});
